import React from 'react'

const Footer = () => {
    return (
        <header className='footer'>
            <div className='eightyperc-container'>
                <div className='footer-main'>
                    <p>Copyright &copy; 2021 WeCare Home Solutions.</p>
                </div>
            </div>
        </header>
    )
}

export default Footer
